import React from "react";
import Navbar from "./components/Navbar";
import Main from "./components/Main";
import Location from "./components/Location"; // Importa el nuevo componente
import Footer from "./components/Footer";
import ContactForm from "./components/ContactForm"; // Importa el componente de Contacto usando el nombre original
import "./styles/App.css"; // Asegúrate de importar los estilos

const App = () => {
  return (
    <div className="App">
      <Navbar />
      {/* Main ya contiene el contenido principal, no es necesario envolverlo en <main> */}
      <Main /> 
      <Location />
      <ContactForm /> {/* Usa el nombre original del componente */}
      <Footer />
    </div>
  );
};

export default App;
